import React from 'react';
import { Link } from 'react-router-dom';
import Menu from './Menu';
import './styles/Header.css';

const Header = () => (
    <header className="header">
    <div className="logo">
      <h1>My Website</h1>
    </div>
    <Menu />
  </header>
);

export default Header;
